    return (
        <Box align="center">
        <Avatar pad="none" size="large" src={src} round="large" />
        <Heading pad="none">Jane Doe</Heading>
        <Text>@janedoe00</Text>
        <Box direction="row">
        <Text>0 followers</Text>
        <BsDot/>
        <Text>0 following</Text>
        </Box>
        </Box>

    )
}

